import React from 'react';
import './TopBar.scss';

function TopBar() {
  return (
    <div id="navigation-bar">
      <nav>
        <ul>
          <li>Home</li>
          <li>Projects</li>
          <li>About</li>
        </ul>
      </nav>
    </div>
  );
}

export default TopBar;
